unsigned long long int reverse_number(unsigned long long int n) {
	if (n < 10)
		return n * 10;
	unsigned long long int t = n;
	unsigned long long int sum = 0;
	while (t > 0) {
		sum = sum * 10 + (t % 10);
		t /= 10;
	}
	return sum;
}

char* reverse_string(char* t) {
	char* s = strdup(t);
	for (int i = 0; i < floor(strlen(s) / 2.0); ++i) {
		char tmp = s[i];
		s[i] = s[strlen(s) - i - 1];
		s[strlen(s) - i - 1] = tmp;
	}
	return s;
}
